import React from 'react';
import Modal from 'react-modal';

// export const Modal1 = ({open, setOpen}) => {
export const Modal1 = (props) => {

    const { set, setOpen, data } = props;

    const close = () => {
        setOpen(false);
    }

    return (
    <Modal isOpen={set}>
        modal open!
        {{ data }}
        <button onClick={close}>X</button>
    </Modal>
  )
}
